import * as yup from "yup";

export const sports = {
  schema: yup.object({
    name: yup.string().required(),
  }),
  initialValues: {
    name: "",
  },
};

export const leagues = {
  schema: yup.object({
    name: yup.string().required(),
  }),
  initialValues: {
    name: "",
    level: "",
    sport_index: 0,
  },
};
